import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, SafeAreaView, Image, Platform, ActivityIndicator } from 'react-native';
import OrderScreen from './app/screens/OrderScreen';
import { store } from './app/store/store';
import { Provider } from 'react-redux';
import { ApiProvider } from '@reduxjs/toolkit/query/react';
import { plantsApi } from './services/plants';
import {useEffect} from 'react';

export default function App() {

  const [isLoding, setIsLoding] = useState(true);
  const [dataSource, setdataSource] = useState(null);


  useEffect(() => {
    console.log('HI APP');
      return fetch('https://dev-agwa-public-static-assets-web.s3-us-west-2.amazonaws.com/data/catalogs/plants.json')
      .then(response => response.json)
      .then(responseJson=>{
        setIsLoding(false);
        setdataSource(responseJson);
      })
      .catch(error => {
        console.log(error);
      })


  },[]);


  return (
    <Provider store={store}>
      <SafeAreaView style={styles.container}>
        <OrderScreen />
      </SafeAreaView>
    </Provider>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    paddingTop: Platform.OS === "android" ? StatusBar.currentHeight : 0
  },
});
